import React from 'react';
import Layout from "../../Layouts/Layout";
import auth from "../../../auth"

class Compositions extends React.Component {
    render() {
        return (
            <Layout>
                <div>
                    <h1>Compositions</h1>
                    <button onClick={() => {
                        auth.logout(() => {
                            this.props.history.push('/')
                        })
                    }}>Logout</button>
                </div>
            </Layout>
        );
    }
}

export default Compositions
